	/** make zkdecrypto-style statistics file from text file samples in the given directory */
	public static void generateZKStats(String inputFolder, String outputFolder, int nMin, int nMax, boolean withSpaces) {
		FileUtil.DEACCENT = true;
		FileUtil.ENCODING = "ISO-8859-1";

		Map<Integer, String> names = new HashMap<Integer, String>();
		names.put(2, "bigraphs");
		names.put(3, "trigraphs");
		names.put(4, "tetragraphs");
		names.put(5, "pentagraphs");
		names.put(6, "hexagraphs");
		names.put(7, "heptagraphs");
		names.put(8, "octagraphs");
		
		Map<Integer, Map<String, Long>> counts = new HashMap<Integer, Map<String, Long>>(); 
		File folder = new File(inputFolder);
		for (File file : folder.listFiles()) {
			if (file.isDirectory()) continue;
			if (file.getName().endsWith(".txt")) {
//				String sample = FileUtil.convert(FileUtil.loadFrom(file.getAbsolutePath()));
				System.out.println("Processing " + file.getAbsolutePath());
				String sample;
				if (withSpaces)
					sample = FileUtil.tokenizeAndConvertToString(FileUtil.loadSBFrom(file.getAbsolutePath()).toString());
				else 
					sample = FileUtil.convert(FileUtil.loadFrom(file.getAbsolutePath()));
//				System.out.println(sample.substring(0, 10000));
				for (int i=0; i<sample.length(); i++) {
					for (int n=nMin; n<=nMax; n++) {
						if (i+n <= sample.length()) {
							String ngram = sample.substring(i, i+n);
							Map<String, Long> map = counts.get(n);
							if (map == null) map = new HashMap<String, Long>();
							counts.put(n, map);
							Long val = map.get(ngram);
							if (val == null) val = 0l;
							val++;
							map.put(ngram, val);
						}
					}
				}
			}
		}
//		List<Long> sorted = new ArrayList<Long>(counts.get(2).values());
//		Collections.sort(sorted);
//		for (Long val : sorted) {
//			System.out.println((int)(10*Math.log(val)));
//		}
		for (Integer n : counts.keySet()) {
			List<String> lines = new ArrayList<String>();
			for (String ngram : counts.get(n).keySet()) {
				Long val = counts.get(n).get(ngram);
				int v = (int)(10*Math.log(val));
				if (v > 0) lines.add(ngram + " : " + v + " 0");
			}
			String w = withSpaces ? "with" : "without";
			String f = outputFolder + "/" + names.get(n) + "-" + w + "-spaces.txt";
			System.out.println("Writing " + f + "...");
			FileUtil.writeText(f, lines);
		}
	}
	
