	/** return zkdecrypto-style score for the given string.  expects uppercase string. */
	public static float zkscore(String[] words) {
		StringBuffer sb = new StringBuffer();
		for (String word: words) sb.append(word);
		return zkscore(sb);
	}
	public static float zkscore(StringBuffer sb) { return zkscore(sb, false, false); }
	public static float zkscore(StringBuffer sb, boolean uniquesOnly, boolean debug) {
		if (sb == null) return 0;
		Set<String> seen = null;
		if (uniquesOnly) seen = new HashSet<String>();
		float result = 0;
		for (int n=2; n<6; n++) {
			float sum = 0;
			for (int i=0; i<sb.length()-n+1; i++) {
				String sub = sb.substring(i, i+n);
				if (!uniquesOnly || (uniquesOnly && !seen.contains(sub))) {
					sum += valueFor(sub);
					if (debug && valueFor(sub) > 0) System.out.println(n + " " + valueFor(sub) + " " + sub);
				}
				if (uniquesOnly) seen.add(sub);
			}
			//System.out.println("len " + n + " sum " + sum);
			sum = sum/((float)Math.pow(2, 5-n));
			result += sum;
		}
		return result;
	}
	// for CSRA testing
	public static float zkscore2(String sb) {
		if (sb == null)
			return 0;
		int n = 5;
		float sum = 0;
		Set<String> seen = new HashSet<String>();
		for (int i = 0; i < sb.length() - n + 1; i++) {
			String sub = sb.substring(i, i + n);
			if (seen.contains(sub)) continue;
			seen.add(sub);
			float val = valueFor(sub);
			if (val > 0)
				//sum += Math.log(val);
				sum += val;
		}
		return sum;
	}

	/** return distance of given string's n-graph distribution to that of normal english */
	public static float[] ngraphDistance(int n, StringBuffer sb) {
		if (sb == null) return new float[] {0f, 0f};
		
		float result = 0;
		float sum = 0;

		Map<String, Integer> map = new HashMap<String, Integer>();
		
		for (int i=0; i<sb.length()-n+1; i++) {
			String ngraph = sb.substring(i, i+n).toUpperCase();
			Integer val = map.get(ngraph);
			if (val == null) val = 0;
			val++;
			map.put(ngraph, val);
		}
		int inv = 0;
		
		if (n == 1) {
			for (String ngraph : ngramMaps.get(n).keySet()) {
				Float expected = ngramMaps.get(n).get(ngraph);
				if (expected == null) expected = 0f;
				expected /= 100;
				Integer count = map.get(ngraph);
				if (count == null) count = 0;
				float found = ((float) count)/(sb.length()-n);
				//System.out.println(ngraph + "," + val + "," + expected + "," + found);
				result += Math.pow(expected-found,2);
			}
			
		} else {
			for (String ngraph : ngramMaps.get(n).keySet()) {
				Float val = ngramMaps.get(n).get(ngraph);
				if (val == null) val = 0f;
				float expected = val / ngramTotals.get(n);
				Integer count = map.get(ngraph);
				if (count == null) count = 0;
				float found = ((float) count)/(sb.length()-n);
				//System.out.println(ngraph + "," + val + "," + expected + "," + found);
				result += Math.pow(expected-found,2);
				map.remove(ngraph);
			}
			for (String ngraph : map.keySet()) { // invalid ngraphs (i.e., they do not appear in our freq statistics at all) 
				Integer count = map.get(ngraph);
				if (count == null) count = 0;
				float found = ((float) count)/(sb.length()-n);
				//System.out.println(ngraph + "," + val + "," + expected + "," + found);
				result += Math.pow(found,10);
				//System.out.println("invalid " + ngraph);
				inv++;
			}
			//System.out.println(inv + " invalid " + n + "-graphs.");
		}
		return new float[] {(float) Math.sqrt(result), (float)inv};
	}

	/** count number of bad ngraphs (those which do not appear in the corpus) */
	public static int badNgraphs(int n, StringBuffer sb) {
		int bad = 0;
		for (int i=0; i<sb.length()-n+1; i++) {
			String ngraph = sb.substring(i, i+n).toUpperCase();
			Float val = ngramMaps.get(n).get(ngraph);
			if (val == null || val == 0) {
				bad++;
			}
		}
		return bad;
	}
	
