	/** compute differences between expected letter distribution and actual letter distribution */
	public static int diffs(StringBuffer sb) {
		String upper = sb.toString().toUpperCase();
		Map<Character, Integer> map = new HashMap<Character, Integer>();
		int L = sb.length();
		for (int i=0; i<L; i++) {
			Character key = upper.charAt(i);
			Integer val = map.get(key);
			if (val == null) val = 0;
			val++;
			map.put(key, val);
		}
		int diffs = 0;
		//for (Character ch : map.keySet()) System.out.println("ch " + ch + " val " + map.get(ch));
		for (String alpha : ngramMaps.get(1).keySet()) {
			float freq = ngramMaps.get(1).get(alpha)/100;
			int expected = (int)(L*freq);
			Integer count = map.get(alpha.charAt(0));
			if (count == null) count = 0;
			diffs += Math.abs(expected-count);
			//System.out.println("alpha " + alpha + " expected " + expected + " actual " + count);
		}
		return diffs;
	}
	
