	public static float scoreNgrams(StringBuffer sb, int n) {
		float sum = 0f;
		for (int i=0; i<sb.length()-n+1; i++) {
			String ngram = sb.substring(i,i+n);
			sum += valueFor(ngram);
		}
		return sum;
	}
	
