	// expansion of Jurgen's brute force tests 
	public static void testBrute() {
		String[] trigrams = new String[] {"the","and","ing","her","tha","hat","ere","his","nth","eth","ent","dth","was","thi","tth","oth","ith","int","hes","for","you","wit","ver","she","fth","edt","ter","sth","oft","not"};
		String[] bigrams = new String[] {"th","he","in","er","an","re","nd","ha","ed","to","es","en","at","st","ou","on","nt","hi","ea","it","is","as","or","ng","et","ar","ti","te","se","of"};
		String[] alpha = new String[] {"v","k","x","j","q","z"};
		String[] alpha2 = new String[] {"a","e","h","i","n","o","r","s","t"};
		String[] alpha3 = new String[] {"a","b","c","d","e","f","g","h","i","j","k","l","m","n","o","p","q","r","s","t","u","v","w","x","y","z"};
		Set<String> seen = new HashSet<String>();
		
		String tri, b1, x, c, b2, b3, b4, g, y;
		StringBuffer line;
		long count = 0;
		float best = Float.MIN_VALUE; 
		boolean found = false;
		float zk;
		for (int a=0; a<trigrams.length; a++) {
			tri=trigrams[a];
			String key = tri.substring(1);
			if (seen.contains(key)) continue;
			seen.add(key);
			System.out.println("TRIGRAM: " + tri);
			for (int b=0; b<bigrams.length; b++) {
				b1 = bigrams[b];
				if (b1.charAt(0) == tri.charAt(1)) {
					c = ""+tri.charAt(2);
					for (int d=0; d<alpha.length; d++) {
						x = alpha[d];
						for (int e=0; e<bigrams.length; e++) {
							b2 = bigrams[e];
							for (int f=0; f<bigrams.length; f++) {
								b3 = bigrams[f];
								for (int h=0; h<alpha2.length; h++) {
									g = alpha2[h];
									for (int j=0; j<alpha3.length; j++) {
										y = alpha3[j];
										for (int i=0; i<bigrams.length; i++) {
											found = false;
											b4 = bigrams[i];
											line = new StringBuffer();
											line.append(b1).append(x).append(c).append(b2).append(b3).append(g).append(y).append(b4);
											zk = zkscore(line);
											if (zk > best) {
												best = zk;
												found = true;
											}
											if (zk >= 0.9*best) {
												System.out.println(line + ","+zk+","+badNgraphs(2,line)+","+badNgraphs(3,line)+(found?",NEW BEST":""));
											}
											count++;
											//if (count % 100000 == 0) System.out.println(a + "," + b + "," + d + ": " + count);
										}
									}
								}
							}
						}
					}
				}
			}
		}
		System.out.println(count + " total.");
	}

