	/** compute average ngram counts over many shuffles.  generate data to plot
	 * counts of every symbol combination. */
	public static void shuffleTest(int shuffles, String cipher) {
		NGramsBean beanOriginal = new NGramsBean(2, cipher);
		
		Map<String, Integer> counts = new HashMap<String, Integer>();
		String alphabet = Ciphers.alphabet(cipher);
		for (int a=0; a<alphabet.length(); a++) {
			for (int b=0; b<alphabet.length(); b++) {
				String key = "" + alphabet.charAt(a) + alphabet.charAt(b);
				counts.put(key,  0);
			}
		}
		
		for (int i=0; i<shuffles; i++) {
			cipher = CipherTransformations.shuffle(cipher);
			NGramsBean ng = new NGramsBean(2, cipher);
			for (String key : ng.counts.keySet())
				counts.put(key, counts.get(key)+1);
		}
		for (String key : counts.keySet()) {
			float mean = counts.get(key);
			mean /= shuffles;
			Integer originalCount = beanOriginal.counts.get(key);
			if (originalCount == null) originalCount = 0;
			
			System.out.println(mean + "	" + (originalCount-mean) + "	" + originalCount + "	" + key);
		}
	}
	
	/** stats for n-gram repeat counts for shuffles */
	public static void shuffleTest2(String str, int n, int shuffles) {
		System.out.println(str);
		NGramsBean beanOriginal = new NGramsBean(n, str);
		StatsWrapper stats = new StatsWrapper();
		stats.actual = beanOriginal.numRepeats();
		for (int i=0; i<shuffles;i++) {
			String shuffled = CipherTransformations.shuffle(str);
			NGramsBean ng = new NGramsBean(n, shuffled);
			if (i==0) {
				System.out.println(shuffled + ", " + ng.numRepeats());
			}
			stats.addValue(ng.numRepeats());
		}
		System.out.println(stats.header());
		stats.output();
	}
	/** stats for n-gram repeat counts for uniformly random strings with the same length as the given string */
	public static void shuffleTest3(String str, int n, int shuffles) {
		Random rand = new Random();
		String alpha = "ABCDEFGHIJKLMNOPQRSTUVWXYZ";
		NGramsBean beanOriginal = new NGramsBean(n, str);
		StatsWrapper stats = new StatsWrapper();
		stats.actual = beanOriginal.numRepeats();

		for (int i=0; i<shuffles;i++) {
			StringBuffer sb = new StringBuffer();
			for (int j=0; j<str.length(); j++) {
				sb.append(alpha.charAt(rand.nextInt(alpha.length())));
			}
			NGramsBean ng = new NGramsBean(n, sb.toString());
			if (i==0) {
				System.out.println(sb + ", " + ng.numRepeats());
			}
			stats.addValue(ng.numRepeats());
		}
		System.out.println(stats.header());
		stats.output();
	}
